
//	Основи на Компютърната Графика
//	Модел 26341 - Обект в деформиращ се обхващащ куб
//	П. Бойчев, 2017


// конструктор на модела
MEIRO.Models.M26341 = function M26341(room)
{
	MEIRO.Model.apply(this, arguments);

	this.map = new THREE.TextureLoader().load('data:image/jpeg;base64,');
	this.map.anisotropy = 16;

	
	this.points = [];
	for (var i=0; i<3; i++)
	{
		this.points[i] = [];
		for (var j=0; j<3; j++)
		{
			this.points[i][j] = [];
			for (var k=0; k<3; k++)
				this.points[i][j][k] = new THREE.Vector3();
		}
	}

	this.nx = 40;
	this.ny = 20;
	
	// пръстени, линии и блокове
	this.object = new THREE.Mesh(
		new THREE.PlaneGeometry(1,1,this.nx,this.ny),
		new THREE.MeshPhongMaterial({map:this.map,shininess:50})
	);
	
	this.k = 0;
	
	// бутон за превключване
	var that = this;
	this.toggle = new MEIRO.CornerButton('topLeft', function(){that.onToggle();}, 'На градус', 'images/start.stop.png');
	this.toggle.hide();

	// сглобяване на целия модел
	this.image.add(this.object);
}

MEIRO.Models.M26341.prototype = Object.create(MEIRO.Model.prototype);

MEIRO.Models.M26341.DIST = {MIN:20, MAX:60, HEIGHT:0};
MEIRO.Models.M26341.POS = {DIST:30, ROT_X:2.5, ROT_Y:0.2};
MEIRO.Models.M26341.ROT_Y = {MIN:-0.1, MAX:0.7};


// аниматор на модела
MEIRO.Models.M26341.prototype.onAnimate = function(time)
{	
	var n = 3;
	for (var i=0; i<3; i++)
	for (var j=0; j<3; j++)
	for (var k=0; k<3; k++)
		this.points[i][j][k].set(
			n*(i-1) + this.k*(Math.cos(rpm(time,10+i+j+k)+i+j+k)+2*Math.cos(rpm(time,20)+2*j)),
			(3+this.k*(j==0?0:Math.sin(rpm(time,30)-i-j-k)))*n*(j-1) + this.k*2*Math.cos(rpm(time,15+i-j+k)+i+j-k),
			n*(k-1) + this.k*Math.sin(rpm(time,20-i+j-k)-i+j+k)
		);
	
	function B(i,t)
	{
		switch (i)
		{
			case 0: return (1-t)*(1-t);
			case 1: return 2*(1-t)*t;
			case 2: return t*t;
		}
	}
	
	var vec = new THREE.Vector3();
	var pnt=0;
	for (var y = 0; y<=this.ny; y++)
	for (var x = 0; x<=this.nx; x++)
	{
		var a = -x/this.nx * 2*Math.PI;
		var r = (1.3*Math.sin(-0.26*y-0.7)+2)/5;
		
		var v = 1-y/this.ny;
		
		if (y==0) r=0;
		if (y==1) r=0.12,v=1;
		if (y==2) r=0.12;
		if (y==3) r=0.16,v=0.95;
		if (y==this.ny-1) v=0;
		if (y==this.ny) r=0;
		
		if (x==0 || x==this.nx) r *= 0.99;
		
		var u = 0.5+r*Math.cos(a);
		var w = 0.5+r*Math.sin(a);

		vec.set(0,0,0);
		for (var i=0; i<3; i++)
		for (var j=0; j<3; j++)
		for (var k=0; k<3; k++)
		{
			vec.addScaledVector( this.points[i][j][k],B(i,u)*B(j,v)*B(k,w) );
		}
		
		this.object.geometry.vertices[pnt].copy(vec);
		pnt++;
	}
	this.object.geometry.computeVertexNormals();
	this.object.geometry.verticesNeedUpdate = true;

	TWEEN.update();
	if (this.k>0) reanimate();
}



// информатор на модела
MEIRO.Models.M26341.prototype.onInfo = function(element)
{
	var s = '';
	s += '<h1>Обект в деформиращ се обхващащ куб</h1>';

	s += '<p>Обектът в този модел е бутилка, описана като ротационно тяло със синусоидален контур. Обектът е поставен в квадратично пространство на Безие, което се контролира от 27 точки (3x3x3). При движение на точките се деформира пространството, а от там и обектът в него.</p>';
	
	element.innerHTML = s;
}


// превключвател на модела
MEIRO.Models.M26341.prototype.onToggle = function(element)
{
	var that = this;
	new TWEEN.Tween({k:that.k})
		.to({k:that.k<0.5?1:0},2500)
		.easing( TWEEN.Easing.Quadratic.InOut )
		.onUpdate( function(){that.k=this.k} )
		.start();

	reanimate();
}
